-- We also know that some fields may not conform to the VARCHAR2 data type. 
-- However, in the process of crawling and processing the data, the empty values were treated as '-', so we first saved them as VARCHAR2 to avoid data-type collisions


-- Member Table
-- use id as uuid
-- use pw as one-way-encrypt for security
CREATE TABLE member(
    id VARCHAR(100) NOT NULL PRIMARY KEY,
    username VARCHAR2(30) NOT NULL,
    password VARCHAR2(1000) NOT NULL,
    email VARCHAR2(1000) NOT NULL
);

-- Team information
-- all of information of team informations should not be null
CREATE TABLE team_info(
    teamid VARCHAR2(1000) NOT NULL PRIMARY KEY,
    teamname VARCHAR2(50) NOT NULL,
    leaguetype VARCHAR2(30) NOT NULL,
    totalgamecount VARCHAR2(20) NOT NULL, -- NUMBER
    winingpoint VARCHAR2(20)  NOT NULL, -- NUMBER
    win VARCHAR2(20)  NOT NULL, -- NUMBER
    draw VARCHAR2(20)  NOT NULL, -- NUMBER
    lose VARCHAR2(20)  NOT NULL, -- NUMBER
    score VARCHAR2(20)  NOT NULL, -- NUMBER
    losspoint VARCHAR2(20)  NOT NULL, -- NUMBER
    current_five VARCHAR2(40),
    imgurl VARCHAR(1500)
);

-- Homeground information of teams
-- primary key teamid references team table's teamid : if team deleted -> stadium deleted
CREATE TABLE team_homeground(
    teamid VARCHAR2(1000) NOT NULL PRIMARY KEY,
    stadiumname VARCHAR2(50) NOT NULL,
    CONSTRAINT fk_team FOREIGN KEY (teamid) REFERENCES team_info(teamid) ON DELETE CASCADE
);

-- Player information
-- primary key playerid references team table's teamid
CREATE TABLE player_info(
    playerid VARCHAR2(1000) NOT NULL PRIMARY KEY,
    playername VARCHAR2(50) NOT NULL,
    teamid VARCHAR2(1000),
    leaguetype VARCHAR2(30) NOT NULL,
    position VARCHAR2(30),
    backnumber VARCHAR2(20) , -- NUMBER
    height VARCHAR2(20) , -- NUMBER
    weight VARCHAR2(20) , -- NUMBER
    birth VARCHAR(20), -- DATE
    imgurl VARCHAR(1500)
);

-- previous leageu datas
CREATE TABLE previous_league( 
    leaguename VARCHAR2(60) NOT NULL PRIMARY KEY,
    year VARCHAR2(20) NOT NULL
);

-- connection table between player_info and previous_league (m : n)
CREATE TABLE player_prev_league(
    playerid VARCHAR2(1000) NOT NULL,
    leaguename VARCHAR2(1000) NOT NULL,
    teamid VARCHAR2(1000) NOT NULL,
    participant VARCHAR2(20) , -- NUMBER
    winningpoint VARCHAR2(20) , -- NUMBER
    assist VARCHAR2(20) , -- NUMBER
    goalkick VARCHAR2(20) , -- NUMBER
    cornerkick VARCHAR2(20) , -- NUMBER
    offside VARCHAR2(20) , -- NUMBER
    shooting VARCHAR2(20) , -- NUMBER
    foul VARCHAR2(20) , -- NUMBER
    losspoint VARCHAR2(20) , -- NUMBER
    warning VARCHAR2(20) , -- NUMBER
    left VARCHAR2(20) , -- NUMBER
    -- CONSTRAINT prev_connector_pk PRIMARY KEY (playerid,leagueid),
    CONSTRAINT prev_player_league_pk PRIMARY KEY (playerid, leaguename),
    CONSTRAINT fk_player FOREIGN KEY (playerid) REFERENCES player_info(playerid) ON DELETE CASCADE,
    CONSTRAINT fk_prevleague FOREIGN KEY (leaguename) REFERENCES previous_league(leaguename) ON DELETE CASCADE
);

